import React, { Component } from 'react'
import Item from './Item'

class Items extends Component {
    constructor(){
        super()
        this.state = {
            selected: false
        }
    }

    onClick = () => {
        this.setState({selected: !this.state.selected})
    }

    render () {
        return (
            <React.Fragment>
                <Item selected={this.state.selected} onClick={this.onClick}/>
                <Item selected={this.state.selected} onClick={this.onClick}/>
           </React.Fragment>
        )
    }
}

export default Items
